/**
 * Clear the IntArray (set all elements to zero).
 * @param resize - if resize is true, then clear actually allocates
 * a new array of size 0, essentially 'clearing' the array and freeing
 * memory.
 */
public void clear(boolean resize) {
  init(resize);
}

